import base64
import os

# 제공받은 base64 문자열 (실제 데이터로 교체 필요)
# 이 문자열은 매우 길 수 있습니다.
base64_string =  ""
# 저장할 파일명 및 경로
output_filename = "decoded_image.png"
output_path = os.path.join(os.getcwd(), output_filename) # 현재 작업 디렉토리에 저장

def decode_base64_to_image(encoded_string, file_path):
    """
    base64로 인코딩된 문자열을 이미지 파일로 디코딩하여 저장합니다.

    Args:
        encoded_string (str): base64 인코딩된 문자열.
        file_path (str): 이미지를 저장할 경로.
    """
    try:
        # base64 문자열에서 데이터 부분만 추출 (헤더 제거, 예: "data:image/png;base64,")
        # 제공된 문자열이 순수 base64 데이터라고 가정합니다.
        # 만약 데이터 URI 스킴 형태라면, 아래 주석 처리된 코드를 사용하세요.
        # if ',' in encoded_string:
        #     header, encoded_string = encoded_string.split(',', 1)
        
        image_data = base64.b64decode(encoded_string)
        
        with open(file_path, "wb") as image_file:
            image_file.write(image_data)
        print(f"이미지가 성공적으로 '{file_path}'에 저장되었습니다.")
    except base64.binascii.Error as e:
        print(f"Base64 디코딩 오류: {e}")
        print("입력된 문자열이 유효한 base64 인코딩인지 확인해주세요.")
    except Exception as e:
        print(f"이미지 저장 중 오류 발생: {e}")

